<div id="app">
  <style>
    /* ... (KEEP YOUR ORIGINAL STYLES HERE) ... */
    :root {
      font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
    }

    body {
      margin: 0;
      overflow: hidden;
    }

    .container {
      margin-top: 1rem;
      display: flex;
      flex-direction: column;
      gap: 8px;
      padding: 16px;
      padding-top: 1.5rem;
      position: relative;
      z-index: 20;
      background-color: white;
      box-shadow: 0px -4px 12px 2px rgba(0, 0, 0, 0.25);
      border-radius: 0.75rem 0.75rem 0px 0px;
    }

    label {
      font-size: small;
      color: #535353;
      font-weight: 500;
    }

    input[type="number"] {
      padding: 8px 10px;
      border: 1px solid #E6E6E6;
      border-radius: 4px;
      flex-grow: 1;
      box-sizing: border-box;
    }

    input[type="number"]:focus {
      outline: none;
      border-color: #18A0FB;
    }

    button {
      padding: 8px 10px;
      background-color: #18A0FB;
      color: white;
      border: none;
      border-radius: 4px;
      font-weight: 600;
      cursor: pointer;
      transition: background-color 0.1s;
    }

    button:hover:not(:disabled) {
      background-color: #0E77D3;
    }

    button:disabled {
      background-color: #CCCCCC;
      cursor: not-allowed;
    }

    .input-and-button {
      display: flex;
      gap: 0.25rem;
    }

    /* Disabled style */
    .message {
      font-size: small;
      color: #535353;
      min-height: 15px;
    }

    svg {
      margin-bottom: -2rem;
    }
  </style>

  <form class="container">
    <label for="space-input">Add space on the right (px)</label>
    <div class="input-and-button">
      <input type="number" id="space-input" value="400" min="1" placeholder="e.g. 400">
      <button id="move-button" disabled>Make way!</button>
    </div>
    <div id="message" class="message"></div>

  </form>

<script>
  // Get elements
  const spaceInput = document.getElementById('space-input')
  const moveButton = document.getElementById('move-button')
  const messageDiv = document.getElementById('message')

  spaceInput.focus()

  // Listen for message from code.ts
  onmessage = (event) => {
    const msg = event.data.pluginMessage

    if (msg.type === 'selectionState') {
      messageDiv.textContent = msg.message

      if (msg.state === 'VALID') {
        moveButton.disabled = false
        // Only set the default if the user hasn't typed anything yet or if it's the initial load
        if (document.activeElement !== spaceInput) {
          spaceInput.value = msg.defaultSpace
        }
      } else {
        moveButton.disabled = true
      }
    }
  }

  // Listen for button click
  moveButton.onclick = () => {
    const spaceValue = spaceInput.value

    // Send the value back to code.ts
    parent.postMessage({
      pluginMessage: {
        type: 'move',
        value: spaceValue
      }
    }, '*')
  };
</script>
